import { Context } from "../Context";
import Navbar from "../Navbar";
import useStyles from "../styles";
import { FormGroup } from "@material-ui/core";

function Chat() {

  const {
    allChatsOfUserState,
    getAllChatsOfUser
  } = useContext(Context);

  useEffect(() => {
    getAllChatsOfUser();
  }, []);

  const styles = useStyles();

  return (
    <main className={styles.main}>
      <Navbar />
      <div>This is the chat page</div>
    </main>
  )
}

export default Chat;
